import React from 'react';
import styles from './users.module.css'

let Users =  (props) => {

    if(props.users.length === 0){
        props.setUsers(
            [
            {id: 1, photoUrl:'data:image/jpeg;base64,', 
            followed: false, fullName: 'Julia', status:'I love you', location:{city:'Kazan', country:'Russia'} },
            {id: 2, photoUrl:'data:image/jpeg;base64,', 
            followed: true, fullName: 'Mike', status:'MayNaczh', location:{city:'Bern', country:'Germany'} },
            {id: 3, photoUrl:'data:image/jpeg;base64,', 
            followed: false, fullName: 'Hoerh', status:'Hienz', location:{city:'Zubrovica', country:'Horvaty'} },
            {id: 4, photoUrl:'data:image/jpeg;base64,', 
            followed: true, fullName: 'Smile', status:'I wish', location:{city:'Pleasure', country:'Dream'} },
            ]
        )
    }

    return <div>
        {
        props.users.map( u => <div key={u.id}>
            <span>
                <div>
                    <img src={u.photoUrl} alt="" className={styles.usersPhoto}/>
                </div>
                <div>
                    {u.followed 
                    ? <button onClick = { () => { props.unfollow(u.id) } }>Unfollow</button> 
                    : <button onClick = { () => { props.follow(u.id) } }>Follow</button>}
                    
                </div>
            </span>
            <span>
                <span>
                    <div>{u.fullName}</div>
                    <div>{u.status}</div>
                </span>
                <span>
                    <div>{u.location.country}</div>
                    <div>{u.location.city}</div>
                </span>
            </span>

        </div>)
    }
    </div>
}

export default Users;